import React, { useState, useEffect } from 'react';
import DeleteButton from './DeleteButton';
import Navbar from './Navbar';

const ShowStudentsData = () => {
  const [students, setStudents] = useState([]);
  const [selectedStudent, setSelectedStudent] = useState(null);
  const [showModal, setShowModal] = useState(false);

  useEffect(() => {
    fetchStudents();
    loadBootstrapCSS();
  }, []);

  const fetchStudents = () => {
    fetch('http://localhost:5000/students')
      .then(response => response.json())
      .then(data => {
        console.log(data); // Log the received data
        setStudents(data);
      })
      .catch(error => console.error('Error fetching students:', error));
  };

  const handleDelete = (enrollment_number) => {
    console.log(enrollment_number);
    fetch(`http://localhost:5000/students/${enrollment_number}`, {
      method: 'DELETE',
    })
      .then(response => {
        if (response.ok) {
          console.log(`Student with enrollment number ${enrollment_number} deleted successfully.`);
          // Refresh the list of students after deletion
          fetchStudents();
        } else {
          console.error('Failed to delete student:', response.statusText);
        }
      })
      .catch(error => console.error('Error deleting student:', error));
  };

  const handleUpdate = (student) => {
    setSelectedStudent(student);
    setShowModal(true);
  };

  const handleCloseModal = () => {
    setShowModal(false);
  };

  const loadBootstrapCSS = () => {
    const link = document.createElement('link');
    link.href = 'https://stackpath.bootstrapcdn.com/bootstrap/4.5.2/css/bootstrap.min.css';
    link.rel = 'stylesheet';
    document.head.appendChild(link);
  };

  return (
    <>
      <Navbar /> {/* Include the Navbar component */}
      <div style={{ background: 'linear-gradient(to right, #4a148c, #ff6f00)', minHeight: '100vh' }}>
        <div className="container py-5">
          <div className="container bg-white p-5 rounded shadow">
            <h2>Show Students Data</h2>
            <table className="table table-striped table-hover">
              <thead>
                <tr>
                  <th>Enrollment Number</th>
                  <th>Faculty Number</th>
                  <th>Name</th>
                  <th>Address</th>
                  <th>Hall</th>
                  <th>Course</th>
                  <th>Branch</th>
                  <th>Semester</th>
                  <th>Action</th>
                </tr>
              </thead>
              <tbody>
                {students.map(student => (
                  <tr key={student.enrollment_number}>
                    <td>{student.enrollment_number}</td>
                    <td>{student.faculty_number}</td>
                    <td>{student.name}</td>
                    <td>{student.address}</td>
                    <td>{student.hall}</td>
                    <td>{student.course}</td>
                    <td>{student.branch}</td>
                    <td>{student.semester}</td>
                    <td>
                      <button className="btn btn-danger" onClick={() => handleDelete(student.enrollment_number)}>Delete</button>
                      <button className="btn btn-info mx-2" onClick={() => handleUpdate(student)}>Update</button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
      {showModal && (
        <div className="modal" tabIndex="-1" role="dialog" style={{ display: 'block', backgroundColor: 'rgba(0, 0, 0, 0.5)' }}>
          <div className="modal-dialog" role="document">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title">Update Student Record</h5>
                <button type="button" className="close" data-dismiss="modal" aria-label="Close" onClick={handleCloseModal}>
                  <span aria-hidden="true">&times;</span>
                </button>
              </div>
              <div className="modal-body">
                {/* Form to update student record */}
                <form>
                  <div className="form-group">
                    <label>Enrollment Number:</label>
                    <input type="text" className="form-control" value={selectedStudent?.enrollment_number} readOnly />
                  </div>
                  <div className="form-group">
                    <label>Faculty Number:</label>
                    <input type="text" className="form-control" value={selectedStudent?.faculty_number} readOnly />
                  </div>
                  <div className="form-group">
                    <label>Name:</label>
                    <input type="text" className="form-control" value={selectedStudent?.name} readOnly />
                  </div>
                  <div className="form-group">
                    <label>Address:</label>
                    <input type="text" className="form-control" value={selectedStudent?.address} readOnly />
                  </div>
                  <div className="form-group">
                    <label>Hall:</label>
                    <input type="text" className="form-control" value={selectedStudent?.hall} readOnly />
                  </div>
                  <div className="form-group">
                    <label>Course:</label>
                    <input type="text" className="form-control" value={selectedStudent?.course} readOnly />
                  </div>
                  <div className="form-group">
                    <label>Branch:</label>
                    <input type="text" className="form-control" value={selectedStudent?.branch} readOnly />
                  </div>
                  <div className="form-group">
                    <label>Semester:</label>
                    <input type="text" className="form-control" value={selectedStudent?.semester} readOnly />
                  </div>
                  <button type="submit" className="btn btn-primary">Update</button>
                </form>
              </div>
            </div>
          </div>
        </div>
      )}
    </>
  );
};

export default ShowStudentsData;
